import React from "react";
import "../App.css";
import HomeApi from "./cardsList/HomeApi";
import SellerForm from "./sellingForm/SellerForm";
import Item from "./itemView/Item";
import WatchApi from "./watchList/WatchApi";
import BasketApi from "./basket/BasketApi";
import Register from "./users/Register";
import Login from "./users/Login";
import CheckLogIn from "./CheckLogIn";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import NavBar from "./nav/NavBar";
import  Card3D  from "./cardsList/Card3D";


function App() {
  return (
    <Router>
      <Switch>
        <CheckLogIn path="/sellerForm" component={SellerForm} />
        <Route path="/" exact>
          <NavBar />
          <HomeApi />
          <div className="cardRow">
          <div className="tjino col-2">
          <Card3D />
          </div>
        </div>
        </Route>
        <Route path="/item/:id">
          <Item />
        </Route>
        <Route path="/watchList">
          <WatchApi />
        </Route>
        <Route path="/basketList">
          <BasketApi />
        </Route>
        <Route path="/register">
          <Register />
        </Route>
        <Route path="/login">
          <Login />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
